import React, { Component } from 'react';
import User from '../../models/User';
import './home.css';


interface usersState {
    allUsers : User[];
    filteredUsers : User[];
}

export default class Home extends Component <any, usersState>  {

    constructor(props : any) {
        super(props);

        this.state = {
            allUsers: [
                new User("Ben", 23, "male", false),
                new User("Ben", 23, "male", true),
                new User("Ben", 23, "male", false),
                new User("Ben", 23, "male", false),
                new User("Ben", 23, "male", true),
                new User("Ben", 23, "male", false),
                new User("Ben", 23, "male", true),
            ],
            filteredUsers : new Array <User> ()
        };
    }

    componentDidMount = () => {

    }


    render() {
        return (
            <div>
                <div className="allUsersSquares">
                    {this.state.allUsers.map( (user, index) => 
                        <div key={index} className="userSquare">

                            <div className="userSquareLeft">
                                <p>{user.name}</p>
                                <p>{user.age}</p>
                                <p>{user.gender}</p>
                                {user.active ? <p>User Is Active</p> : <p>User Is Not Active</p>}
                            </div>

                            <div className="userSquareRight">
                                
                            </div>

                        </div>
                    )}
                </div>
            </div>
        )
    }
}
